import React from "react";
import { Route, withRouter, Switch } from "react-router-dom";
import Home from "./pages/Home";

const App = () => {
  return (
    <>
      <Switch>
        <Route path="/" exact component={Home} />
      </Switch>
    </>
  );
};

export default withRouter(App);
